import React from 'react';
import Login from './components/login';
import Main from './components/main';
import Regestration from './components/regectration';
import './App.css';
import { Provider } from "react-redux";
import { createStore } from 'redux';
import { Route, Link, BrowserRouter as Router } from "react-router-dom";

function reducer(state = [], action:any){
    if(action.type === 'addObj'){
      return[
        ...state,

      ]
    }
    console.log(action)
    return state
}


const store = createStore(reducer);

store.subscribe(()=>{
  console.log(store.getState())
})

store.dispatch({type: 'addObj', email: 'some@gmail.com'})

const App: React.FC = () => {
  return (
    <Provider store={store}>
      <Router>
        <ul className="app-nav">
          <li><Link style={{textDecoration: 'none'}}to="/">Main</Link></li>
          <li><Link to="/login">Login</Link></li>
          <li><Link to="/regestration">Regestration</Link></li>
        </ul>
        <Route exact path="/" component={Main} /> 
        <Route path="/login" component={Login} /> 
        <Route path="/regestration" component={Regestration} />
      </Router>
    </Provider>
  );
}

export default App;
